import React, { Component } from "react";
import MenuCategory from "./MenuCategory";
import SelectButton from "./SelectButton";

class AllCategories extends Component {
	state = {};

	orderUpdated = selectedItemsMap => {
		selectedItemsMap.forEach(item => console.log(item));
	};

	render() {
		return (
			<div className="container">
				<ul className="collapsible">
					<MenuCategory
						id="filling"
						orderUpdated={this.orderUpdated}
					/>
				</ul>
				<ul className="collapsible">
					<MenuCategory id="rice" orderUpdated={this.orderUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="beans" orderUpdated={this.orderUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory
						id="topthingsoff"
						orderUpdated={this.orderUpdated}
					/>
				</ul>
				<ul className="collapsible">
					<MenuCategory
						id="options"
						orderUpdated={this.orderUpdated}
					/>
				</ul>
				<ul className="collapsible">
					<MenuCategory id="side" orderUpdated={this.orderUpdated} />
				</ul>
				<ul className="collapsible">
					<SelectButton orderUpdated={this.orderUpdated} />
				</ul>
			</div>
		);
	}
}

export default AllCategories;
